import React from 'react';
import './Sidebar.css';
import categories from '../data/categories.json';

export default function LeftSidebar({ selectedModel, onKeywordClick, selectedKeyword }) {
  return (
    <div className="sidebar left-sidebar">
      <h3 className="sidebar-title">Keywords</h3>
      <ul className="sidebar-list">
        {Object.entries(categories).map(([category, keywords]) => (
          <li key={category} className="sidebar-category">
            <span>{category}</span>
            <ul className="subcategory-list">
              {keywords.map((keyword) => (
                <li
                  key={keyword}
                  className={`sidebar-item ${
                    selectedKeyword === keyword || selectedModel?.keywords.includes(keyword)
                      ? 'selected'
                      : ''
                  }`}
                  onClick={() => onKeywordClick(keyword)}
                >
                  {keyword}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
}
